import React from 'react';
import './Header.css';
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div className={
        'container center f3 bb bw2 br--bottom black'}>
            <h1 className='white code underline'>TodoList</h1>

            {/* Home and About */}
            <div>

                <div>
                <Link className='white f3' to=''>Home </Link> -
                <Link className='white f3' to='/about'> About</Link>
                </div>

            </div>

        </div>
    )
}

export default Header
